}

.Header-logo {
    height: 50px;
}

.login-background {
    background-image: url(http://localhost:3001/static/media/LoginBackgroundBlur.641c7175bb434995b2f3.png);
    background-size: cover;
    height: 100vh;
    background-position: center;
    filter: blur(0px);
}

.login-container {
    background-color: rgba(255, 255, 255, 0.5);
    width: 100%;
    height: 100%;
    display: flex;
    align-items: center;
    justify-content: center;
}

.login-form {
    border-radius: 10px;
    padding-top: 20px;
    padding-right: 20px;
    padding-left: 20px;
    min-width: 200px;
    max-width: 300px;
    border-color: rgb(255, 255, 255);
    border-style: solid;
    display: flex;
    flex-direction: column;
    background-color: rgba(255, 255, 255, 0.4);
    margin-top: -80px;
}

.login-form h2 {
    text-align: center;
}

.login-form label {
    display: block;
    margin-bottom: 10px;
    text-align: left;
}

.login-form input {
    width: 100%;
    padding: 10px;
    border-radius: 5px;
    border: none;
    margin-bottom: 15px;
    box-sizing: border-box;
}

.login-form .login-btn {
    background-color: #008080;
    color: white;
    padding: 10px 20px;
    border: none;
    border-radius: 5px;
    cursor: pointer;
    height: 50px;
    font-size: 15px;
}

.google-login-btn {
    height: 50px;
    color: white;
    border: none;
    border-radius: 5px;
    cursor: pointer;
    background-color: red;
    display: flex;
    flex-direction: row;
    align-items: center;
    justify-content: center;
    font-size: 15px;
    margin-top: 0px;
}

.google-logo {
    height: 25px;
    width: 25px;
    margin-right: 10px;
}

button[type="submit"] {
    display: block;
    margin: 0 auto;
    width: 100%;
}

.create-account-div {
    display: flex;
    flex-direction: row;
    justify-content: center;
    align-items: center;
}

.make-account-message {
    text-align: center;
    font-size: 0.8rem;
    font-style: italic;
}

.create-account-btn {
    border: none;
    cursor: pointer;
    font-size: 0.8rem;
    text-align: center;
    padding-left: 10px;
}

.login-form .login-options {
    display: flex;
    justify-content: center;
    flex-direction: column;
    height: 150px;
}

.create-account-background {
    background-image: url(http://localhost:3001/static/media/LoginBackground.15024f4d2f3b4bb2f09b.png);
    background-size: cover;
    min-height: 100vh;
    display: flex;
    align-items: center;
    justify-content: center;
    background-position: center;
}

.create-account-form {
    background-color: rgba(255, 255, 255, 0.8);
    border-radius: 10px;
    padding: 20px;
    margin: 50px 50px 50px 50px;
    height: 80%;
}

.create-account-form h2 {
    text-align: center;
}

.create-account-form label {
    display: block;
    margin-bottom: 10px;
    text-align: left;
}

.create-account-form input {
    width: 100%;
    padding: 10px;
    border-radius: 5px;
    border: none;
    margin-bottom: 20px;
    box-sizing: border-box;
}

.create-account-form .submit-btn {
    background-color: #008080;
    color: white;
    padding: 10px 20px;
    border: none;
    border-radius: 5px;
    cursor: pointer;
}

.create-account-form .cancel-btn {
    background-color: #db4437;
    color: white;
    padding: 10px 20px;
    border: none;
    border-radius: 5px;
    cursor: pointer;
}

.create-account-form .form-options {
    display: flex;
    justify-content: space-between;
    margin-top: 20px;
}

.create-account-form .form-options button {
    width: 48%;
}

.create-account-form .form-options button:first-child {
    background-color: #008080;
}

.create-account-form .form-options button:last-child {
    background-color: #db4437;
}

.create-account-form .password-match-error {
    color: red;
    margin-top: 10px;
    text-align: center;
}

    display: flex;
    flex-direction: column;
    height: 100%;
}

.background-image {
    background-image: url(http://localhost:3001/static/media/background.45456524e26b34bcbbc6.png);
    background-size: cover;
    align-items: center;
    justify-content: center;
    background-position: center;
    filter: blur(0px);
}

.content-container {
    background-color: rgba(255, 255, 255, 0.7);
    text-align: center;
    align-items: center;
    width: 100%;
    display: flex;
    flex-direction: column;
    padding-bottom: 50px;
}

.content-container h1 {
    font-size: 48px;
    max-width: 800px;
    margin-bottom: 20px;
    padding-left: 20px;
    padding-right: 20px;
}

.content-container h4 {
    padding-top: 20px;
}

.content-container p {
    font-size: 24px;
    line-height: 1.5;
    max-width: 800px;
    padding-left: 50px;
    padding-right: 50px;
    padding-bottom: 40px;
}

.content-container button {
    font-size: large;
    background-color: #008080;
    color: white;
    padding: 10px 20px;
    border: none;
    border-radius: 5px;
    cursor: pointer;
    height: 50px;
}

.horizontal-container {
    display: flex;
    flex-direction: row;
    width: 100%;
    padding-top: 50px;
    padding-bottom: 50px;
    align-items: center;
    justify-content: center;
    border-radius: 0px;
    z-index: 1;
    margin-top: 50px;
    background-color: white;
    align-self: center;
}

.horizontal-container .vertical-container {
    text-align: center;
    align-items: center;
    width: 100%;
    display: flex;
    flex-direction: column;
    margin-left: 50px;
    margin-right: 50px;
}

.horizontal-container p {
    width: 70%;
}

.horizontal-container h2 {
    text-align: center;
    font-size: 34px;
}

.horizontal-container h4 {
    color: green;
}

.chatbox {
    background-color: rgb(0, 0, 0);
    color: #fff;
    padding-top: 20px;
    padding-left: 20px;
    padding-right: 20px;
    margin-top: 0px;
    margin-right: 50px;
    margin-left: 50px;
    /*margin-bottom: -250px;*/
    width: 30rem;
    border-radius: 10px;
    font-family: Lato, sans-serif;
    font-size: 11px;
    display: flex;
    flex-direction: column;
}

.message {
    display: flex;
    align-items: center;
    margin-bottom: 10px;
    text-align: left;
}

.received {
    justify-content: flex-start;
}

.sent {
    justify-content: flex-end;
}

.received h3 {
    font-weight: normal;
    background-color: #323232;
    color: white;
    padding: 10px;
    border-radius: 5px;
    max-width: 80%;
}

.sent h3 {
    font-weight: normal;
    background-color: #489ac0;
    color: white;
    padding: 10px;
    border-radius: 5px;
    max-width: 80%;
}

.received h3 {
    border-top-left-radius: 0;
}

.sent h3 {
    border-top-right-radius: 0;
}

.received h3:last-child {
    border-radius: 10px;
    border-bottom-left-radius: 0px;
}

.sent h3:last-child {
    border-radius: 10px;
    border-bottom-right-radius: 0;
}

@media screen and (max-width: 768px) {
    .content-container p {
        font-size: 14px;
    }
    .content-container h1 {
        font-size: 30px;
    }
    .content-container h4 {
        font-size: 14px;
    }
    .horizontal-container p {
        font-size: 14px;
    }
    .horizontal-container h2 {
        font-size: 30px;
    }
    .chatbox {
        width: 300px;
    }
    .horizontal-container {
        flex-direction: column;
    }
}

@media screen and (max-width: 400px) {
    .chatbox {
        width: 200px;

    border-radius: 4px;

    margin: 10px;

.k-icon {
    width: 1em;
    height: 1em;

    text-transform: none;

    flex-shrink: 0;
    display: inline-flex;
    flex-flow: row nowrap;
    align-items: center;
    justify-content: center;
    vertical-align: middle;
    position: relative;
    -moz-osx-font-smoothing: grayscale;
    -webkit-font-smoothing: antialiased;
}

.k-icon:hover, .k-icon:focus {
    text-decoration: none;
}

.k-svg-icon {
    width: 16px;
    height: 16px;

    display: inline-flex;
    flex-flow: row nowrap;
    align-items: center;
    justify-content: center;
    vertical-align: middle;
    position: relative;
}

.k-svg-icon > svg {
    fill: currentColor;
    flex: 1 1 auto;
}

.k-i-none::before {
    display: none !important;
}

.k-spreadsheet-has-comment::after {
    content: "";
    display: block;
    position: absolute;
    top: 0;
    right: 0;
    left: auto;
    border-width: 3px;
    border-style: solid;
}

.k-dirty {
    left: 0;
    right: auto;
}

.k-spreadsheet .k-filter-wrapper {
    position: relative;
    z-index: 50;
}

.k-spreadsheet .k-filter-range {
    border-width: 1px;
    border-style: solid;
    position: absolute;
    box-sizing: border-box;
}

.k-spreadsheet-filter {
    border-radius: 4px;
    line-height: 1;
    position: absolute;
    cursor: pointer;
}

.k-spreadsheet-filter .k-icon {
    vertical-align: middle;
}

.k-spreadsheet-filter-menu {
    width: 280px;
}

.k-spreadsheet-filter-menu .k-animation-container {
    position: relative;
}

.k-spreadsheet-filter-menu > .k-menu,
.k-spreadsheet-filter-menu > .k-menu.k-menu-vertical {
    border-width: 0;
}

.k-spreadsheet-filter-menu > .k-menu .k-item,
.k-spreadsheet-filter-menu > .k-menu.k-menu-vertical .k-item {
    color: inherit;
}

.k-spreadsheet-filter-menu > .k-menu .k-link,
.k-spreadsheet-filter-menu > .k-menu.k-menu-vertical .k-link {
    padding-left: 24px;
}

.k-spreadsheet-filter-menu > .k-menu .k-icon,
.k-spreadsheet-filter-menu > .k-menu .k-svg-icon,
.k-spreadsheet-filter-menu > .k-menu.k-menu-vertical .k-icon,
.k-spreadsheet-filter-menu > .k-menu.k-menu-vertical .k-svg-icon {
    margin-left: -20px;
    margin-right: 4px;
}

.k-spreadsheet-filter-menu .k-spreadsheet-value-treeview-wrapper {
    height: 200px;
    border-width: 1px;
    border-style: solid;
    overflow-y: scroll;
    overflow-x: auto;
}

.k-spreadsheet-filter-menu .k-spreadsheet-value-treeview-wrapper .k-treeview {
    padding: 4px;
    overflow: visible;
}

.k-spreadsheet-filter-menu .k-details,
.k-spreadsheet-filter-menu .k-expander {
    padding: 0;
    border-width: 1px 0 0;
    border-style: solid;
    border-color: inherit;
}

.k-spreadsheet-filter-menu .k-expander {
    border: 0;
    background: inherit;
}

.k-spreadsheet-filter-menu .k-details-summary,
.k-spreadsheet-filter-menu .k-columnmenu-item {
    padding-block: 4px;
    padding-inline: 8px;
    display: flex;
    align-items: center;
    cursor: pointer;
}

.k-spreadsheet-filter-menu .k-details-summary > .k-icon,
.k-spreadsheet-filter-menu .k-details-summary > .k-svg-icon,
.k-spreadsheet-filter-menu .k-columnmenu-item > .k-icon,
.k-spreadsheet-filter-menu .k-columnmenu-item > .k-svg-icon {
    margin-right: 4px;
}

.k-spreadsheet-filter-menu .k-details-content,
.k-spreadsheet-filter-menu .k-columnmenu-item-content {
    padding: 8px;
    display: flex;
    flex-flow: column nowrap;
    gap: 8px;
}

.k-spreadsheet-filter-menu .k-details-content .k-filter-and,
.k-spreadsheet-filter-menu .k-columnmenu-item-content .k-filter-and {
    width: min-content;
    align-self: flex-start;
}

.k-spreadsheet-filter-menu .k-actions, .k-spreadsheet-filter-menu .k-edit-buttons,
.k-spreadsheet-filter-menu .k-action-buttons,
.k-spreadsheet-filter-menu .k-columnmenu-actions, .k-spreadsheet-filter-menu .k-form-buttons {
    margin: 0;
    padding: 0;
}

.k-spreadsheet-popup {
    padding: 0;
}

.k-spreadsheet-popup .k-separator {
    display: block;
}

.k-spreadsheet-popup .k-reset-color,
.k-spreadsheet-popup .k-custom-color {
    border-radius: 0;
    width: 100%;
    border-width: 0;
    box-sizing: border-box;
    display: flex;
}

.k-spreadsheet-popup .k-reset-color {
    border-bottom-width: 1px;
}

.k-spreadsheet-popup .k-custom-color {
    border-top-width: 1px;
}

.k-spreadsheet-popup .k-spreadsheet-border-type-palette {
    width: 12.5rem;
    height: 5rem;
    display: flex;
    flex-flow: row wrap;
    align-content: space-around;
    justify-content: space-around;
}

.k-spreadsheet-format-popup .k-item {
    justify-content: space-between;
}

.k-spreadsheet-format-popup .k-spreadsheet-sample {
    order: 1;
}

.k-spreadsheet-sample {
    opacity: .7;
}

.k-spreadsheet-clipboard,
.k-spreadsheet-clipboard-paste {
    margin: 0;
    padding: 0;
    width: 1px;
    height: 1px;
    border: 0;
    opacity: 0;
    position: absolute;
    top: 0;
    left: 0;
    overflow: hidden;
}

.k-spreadsheet-window .k-edit-form-container {
    width: auto;
    min-width: 0;
}

.k-spreadsheet-format-cells .k-spreadsheet-preview {
    margin-top: 8px;
    text-align: center;
}

.k-spreadsheet-format-cells .k-list-scroller {
    margin-top: 8px;
    height: 210px;
    border-width: 1px;
    border-style: solid;
    border-color: inherit;
}

.k-export-config {
    clear: both;
    position: relative;
}

.k-export-config::after {
    content: "";
    clear: both;
    display: block;

.k-export-config .k-edit-field {
    margin-left: 5%;
    width: 45%;
    float: left;
}

.k-export-config .k-page-orientation {

    right: 0;
    top: 8px;
}

.k-export-config .k-page-orientation .k-icon {

}

.k-export-config .k-page-orientation .k-svg-icon {
    width: 6em;
    height: 6em;
}

.k-spreadsheet-insert-comment textarea {

.k-spreadsheet-insert-image-dialog label div {
    display: flex;
    align-self: flex-end;
    margin-bottom: 30px;
    pointer-events: none;
}

.k-spreadsheet-insert-image-dialog label input {
    display: none;
}

.k-spreadsheet-insert-image-dialog .k-spreadsheet-has-image {
    background-size: auto 90%;
    background-position: 50% 50%;
}

.k-spreadsheet-insert-image-dialog .k-spreadsheet-has-image:hover div,
.k-spreadsheet-insert-image-dialog .k-spreadsheet-has-image.k-hover div {
    margin: 0;
    align-self: center;
    opacity: 1;
}

.k-spreadsheet-insert-image-dialog .k-spreadsheet-has-image div {
    opacity: 0;
}

.k-spreadsheet-drawing {
    position: absolute;
    box-sizing: border-box;
    z-index: 101;
}

.k-spreadsheet-drawing.k-spreadsheet-active-drawing {
    outline-style: solid;
    outline-width: 2px;
}

.k-spreadsheet-drawing .k-spreadsheet-drawing-image {
    position: absolute;
    top: 0;
    left: 0;
    width: 100%;
    height: 100%;
    background-position: 50% 50%;
    background-size: 100% 100%;
    background-repeat: no-repeat;
    cursor: move;
}

.k-spreadsheet-drawing .k-spreadsheet-drawing-handle {
    width: 6px;
    height: 6px;
    border-style: solid;
    border-width: 1px;
    border-radius: 6px;
    position: absolute;
    transform: translate(-50%, -50%);
}

.k-spreadsheet-drawing .k-spreadsheet-drawing-handle.N {
    left: 50%;
    top: 0;
    cursor: ns-resize;
}

.k-spreadsheet-drawing .k-spreadsheet-drawing-handle.NE {
    left: 100%;
    top: 0;
    cursor: nesw-resize;
}

.k-spreadsheet-drawing .k-spreadsheet-drawing-handle.E {
    left: 100%;
    top: 50%;
    cursor: ew-resize;
}

.k-spreadsheet-drawing .k-spreadsheet-drawing-handle.SE {
    left: 100%;
    top: 100%;
    cursor: nwse-resize;
}

.k-spreadsheet-drawing .k-spreadsheet-drawing-handle.S {
    left: 50%;
    top: 100%;
    cursor: ns-resize;
}

.k-spreadsheet-drawing .k-spreadsheet-drawing-handle.SW {
    left: 0;
    top: 100%;
    cursor: nesw-resize;
}

.k-spreadsheet-drawing .k-spreadsheet-drawing-handle.W {
    left: 0;
    top: 50%;
    cursor: ew-resize;
}

.k-spreadsheet-drawing .k-spreadsheet-drawing-handle.NW {
    left: 0;
    top: 0;
    cursor: nwse-resize;
}

.k-spreadsheet-drawing .k-spreadsheet-insert-image-dialog .k-spreadsheet-has-image:hover, .k-spreadsheet-drawing .k-spreadsheet-insert-image-dialog .k-spreadsheet-has-image.k-hover {
    border-radius: 4px;
}

.k-rtl .k-spreadsheet .k-dirty,
.k-spreadsheet[dir="rtl"] .k-dirty {
    right: 0;
    left: auto;
}

.k-rtl .k-spreadsheet .k-spreadsheet-has-comment::after,
.k-spreadsheet[dir="rtl"] .k-spreadsheet-has-comment::after {
    left: 0;
    right: auto;
}

.k-spreadsheet {
    border-color: rgba(0, 0, 0, 0.08);
    color: #424242;
    background-color: #ffffff;
}

.k-spreadsheet-top-corner,
.k-spreadsheet-row-header,
.k-spreadsheet-column-header {
    border-color: rgba(0, 0, 0, 0.08);
    color: #424242;
    background-color: #fafafa;
}

.k-syntax-ref {
    color: #ff8822;
}

.k-syntax-num {
    color: #0099ff;
}

.k-syntax-str {
    color: #38b714;
}

.k-syntax-error {
    color: red;
}

.k-syntax-bool {
    color: #a9169c;
}

.k-syntax-paren-match {
    background-color: #caf200;
}

.k-spreadsheet-cell-editor {
    color: #424242;
    background-color: #ffffff;
}

.k-spreadsheet-merged-cell {
    background-color: #ffffff;
}

.k-spreadsheet-disabled-mask {
    background-color: #ffffff;
}

.k-spreadsheet .k-selection-full,
.k-spreadsheet .k-selection-partial {
    background-color: rgba(255, 99, 88, 0.25);
}

.k-spreadsheet-selection {
    border-color: #ff6358;
    background-color: rgba(255, 99, 88, 0.25);
    box-shadow: inset 0 0 0 1px #ff6358;
}

.k-spreadsheet .k-single-selection::after {
    border-color: #ffffff;
    background-color: #ff6358;
}

.k-spreadsheet-active-cell {
    box-shadow: inset 0 0 0 1px #ff6358;
    background-color: #ffffff;
}

.k-spreadsheet-active-cell.k-right {
    box-shadow: inset 0 0 0 1px #ff6358, inset -1px 0 0 1px #ff6358;
}

.k-spreadsheet-active-cell.k-bottom {
    box-shadow: inset 0 0 0 1px #ff6358, inset 0 -1px 0 1px #ff6358;
}

.k-spreadsheet-active-cell.k-bottom.k-right {
    box-shadow: inset 0 0 0 1px #ff6358, inset -1px -1px 0 1px #ff6358;
}

.k-spreadsheet .k-auto-fill {
    border-color: #ff6358;
    background-color: rgba(255, 99, 88, 0.25);
    box-shadow: inset 0 0 0 1px #ff6358;
}

.k-spreadsheet .k-auto-fill-punch {
    background-color: rgba(255, 255, 255, 0.5);

}

.k-orgchart-group.k-vstack > .k-orgchart-node-container, .k-orgchart-group.k-vbox > .k-orgchart-node-container {
    gap: 0;
}

.k-orgchart-node-container {
    gap: 24px;
}

.k-orgchart-node-group-container {
    border-radius: 4px;
    padding-block: 24px;
    padding-inline: 24px;
    border-width: 1px;
    border-style: solid;
    outline: 0;
}

.k-orgchart-node-group-title {
    margin: 0 0 8px;
    font-size: 16px;
    line-height: 1.25;
}

.k-orgchart-node-group-subtitle {
    margin: 0 0 24px;
    font-size: 14px;
}

.k-orgchart-card {
    width: 300px;
    border-width: 1px;
}

.k-orgchart-card .k-card-title {
    margin: 0 0 0px;
}

.k-orgchart-card .k-card-subtitle {
    margin: 0 0 0px;
}

.k-orgchart-card .k-card-body {
    border-width: 2px 0 0;
    border-style: solid;
    flex-grow: 0;
}

.k-orgchart-card .k-card-body .k-card-title-wrap {
    margin: 0 12px 0 0;
    min-width: 0;
    min-height: 45px;
}

.k-orgchart-line {
    background-color: currentColor;
}

.k-orgchart-line-h {
    height: 1px;
}

.k-orgchart-line-v {
    margin-block: 0;
    margin-inline: auto;
    width: 1px;
    height: 25px;
}

.k-orgchart-button {
    z-index: 1;
}

.k-orgchart {
    border-color: rgba(0, 0, 0, 0.08);
    color: #424242;
    background-color: #ffffff;
}

.k-orgchart-card .k-card-body {
    border-color: transparent;
}

.k-orgchart-card:focus, .k-orgchart-card.k-focus {
    box-shadow: 0 3px 4px 0 rgba(0, 0, 0, 0.06);
}

.k-orgchart-node-group-container {
    border-color: rgba(0, 0, 0, 0.08);
    color: #424242;
    background-color: #fafafa;
}

.k-orgchart-node-group-container:focus,
.k-orgchart-node-group-container.k-focus {
    box-shadow: 0 3px 4px 0 rgba(0, 0, 0, 0.06);
    border-color: rgba(0, 0, 0, 0.15);
}

.k-orgchart-node-group-subtitle {
    color: #666666;
}

.k-orgchart-line-h,
.k-orgchart-line-v {
    color: rgba(0, 0, 0, 0.08);
}

.k-signature {
    width: 250px;
    min-height: 84px;
    position: relative;
    box-sizing: border-box;
    display: flex;
    flex-direction: column;
    justify-content: space-between;
}

.k-signature.k-signature-maximized {
    width: 750px;
    height: 252px;
}

.k-signature.k-signature-maximized > .k-signature-line {
    border-bottom-width: 3px;
}

.k-signature-actions {
    display: flex;
    width: min-content;
    margin-inline-start: auto;
    gap: 4px;
    z-index: 2;
}

.k-signature-canvas {
    position: absolute;
    top: 0;
    left: 0;
    width: 100%;
    height: 100%;
    display: block;
    z-index: 1;
    outline: none;
}

.k-signature-line {
    position: absolute;
    bottom: 33%;
    z-index: 2;
    pointer-events: none;
    border-bottom-width: 1px;
    border-bottom-style: dashed;
}

.k-signature-sm {
    padding-inline: 2px;
    padding-block: 2px;
}

.k-signature-sm .k-signature-line {
    width: calc(100% - 4px);
}

.k-signature-md {
    padding-inline: 4px;
    padding-block: 4px;
}

.k-signature-md .k-signature-line {
    width: calc(100% - 8px);
}

.k-signature-lg {
    padding-inline: 8px;
    padding-block: 8px;
}

.k-signature-lg .k-signature-line {
    width: calc(100% - 16px);
}

.k-signature-lg {
    min-height: 110px;
}

.k-signature .k-signature-line {
    border-bottom-color: rgba(0, 88, 233, 0.24);
}
